
import matplotlib.pyplot as plt
import numpy as np
from pdb import set_trace as bp

tot_lux = 802
tot_cologne = 503
simulator_time_res = 0.05

def extract(data, tot):
	rmin = [x[0] for x in data]
	forwarders = [np.asarray(x[1])*100/tot for x in data]
	reached = [np.asarray(x[2])*100/tot for x in data]
	delay = [np.asarray(x[3])*simulator_time_res for x in data]
	#bp()
	hops = [x[4] for x in data]
	return rmin, forwarders, reached, delay, hops

def boxplot(title, x, data):
	fig, ax = plt.subplots()
	ax.set_title(title)
	data_plot, x_plot = [], []
	for elem1, elem2 in zip(x,data):
		if elem1%50 == 0:   #show only data where rmin is a multiple of 50
			x_plot.append(elem1)
			data_plot.append(elem2)
	ax.boxplot(data_plot)
	ax.set_xticklabels([str(elem) for elem in x_plot])
	plt.show()
	#plt.savefig(title+'.svg', bbox_inces='tight')



